import React from 'react';
import { Link } from 'react-router-dom';

const Project = (props) => {  

  return (
    <div>
      <h2>{props.name}</h2>

      <div>
        <img src={props.image} alt={props.name}/>
      </div>

      <p>{props.description}</p>

      <div>
        <Link>{props.cta1}</Link>
        <Link>{props.cta2}</Link>
        <Link>{props.link}</Link>
      </div>

    </div>
  );
}

export default Project;
